import React, { Component } from 'react';
import Layout from '../components/layout.js';
import CSS from '../components/style.css';
import ProviderList from './provider_data/providerimport.js';


var data = require('./provider_data/provider.json');


function Providerinfo(props) {
  
    return (
      <div>
          <table>
        <tr>
            <th>Total Transportation Providers:</th>
            <td>{data.length}</td>
        </tr>
        <tr>
            <td><b>Transportation Companies</b>:</td>
            <td>{data.filter(data => data.Type === 'Provider').length}</td>
        </tr>
        <tr>
            <td>Volunteer Drivers:</td>
            <td>{data.filter(data => data.Type === 'Volunteer Driver').length}</td>
        </tr>
        </table>
        
         
        Central Region: {data.filter(data => data.Region === 'Central').length}<br/>
        Central Transportation Companies: {data.filter(data => data.Type === 'Provider' && data.Region === 'Central' ).length}<br />
        Central Volunteer Drivers: {data.filter(data => data.Type === 'Volunteer Driver' && data.Region === 'Central').length}<br/>
        SouthWest Region: {data.filter(data => data.Region === 'SouthWest').length}<br/>
        SouthWest Transportation Companies: {data.filter(data => data.Type === 'Provider' && data.Region === 'SouthWest' ).length}<br />
        SouthWest Volunteer Drivers: {data.filter(data => data.Type === 'Volunteer Driver' && data.Region === 'SouthWest').length}<br/>
        East Region: {data.filter(data => data.Region === 'East').length}<br/>
        East Transportation Companies: {data.filter(data => data.Type === 'Provider' && data.Region === 'East' ).length}<br />
        East Volunteer Drivers: {data.filter(data => data.Type === 'Volunteer Driver' && data.Region === 'East').length}<br/>
        
      </div>
    );
  
}


class ProviderData extends Component {
    render() {
        return (
            <Layout>
                <div>
                    <p>this is data imported from a local json file. It will recreate a tracking
                        spreadsheet I created at one of my jobs.
                    </p>
                    <p>I used react-table dependency to build the data table. Altering formatting
                        to match my spreadsheet.
                    </p>
                    <ol>
                        <b>Things to do:</b>
                        <li>see if you can change react-tables css for custom styling</li>
                        <li>double check json file for consistency</li>
                    </ol>
                </div>
                <Providerinfo />
                <ProviderList />
            </Layout>
        );
    }
}

export default ProviderData;
